// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./LevelsNFTFacotry.sol";

contract Router is Ownable {

    event CreateNFT(uint APIndex, address contAddr); // api호출 번호, 계약 주소
    LevelsNFTFacotry[] public createdNFT; // 만들어진 NFT  
    mapping(string => uint32) private mintedName; // 만들어잔 토큰 네임 

    constructor(){

    }

    //levels NFT 생성
    function CreateLevelsNFT(
        string memory _tokenName,
        string memory _tokenSymbol,
        string memory _baseUri,
        uint32 _maxSupply,
        uint _mintPrice,
        uint32 _openTime,
        uint32 _closeTime,
        address[] memory _withdrawWallet) external onlyOwner{
            require(mintedName[_tokenName] == 0,"Already Token Name"); // 0없음 1있음 
        LevelsNFTFacotry object = new LevelsNFTFacotry(
            _tokenName,
            _tokenSymbol,
            _baseUri,
            _maxSupply,
            _mintPrice,
            _openTime,
            _closeTime,
            _withdrawWallet
        );
        object.setAntiBotInterval(60); //인터벌 설정
        mintedName[_tokenName] = 1;
        createdNFT.push(object); // Add created NFT 
        uint len = createdNFT.length - 1; // API Index 
        emit CreateNFT(len, address(object)); //API Response data
    }

    // 구입 
    function _buyNFT(uint APIndex) public payable {
        createdNFT[APIndex].buyNFT{value:msg.value}(msg.sender);
    }
    // 인출  
    function _withdraw(uint APIndex) public payable {
        createdNFT[APIndex].withdraw(msg.sender);
    }

    // 인출 조회 
    function _getWithdraw(uint APIndex) public view returns(uint) {
        uint result = createdNFT[APIndex].getWithdraw(msg.sender);
        return result;
    }

    // URI 조회
    function _tokenURI(uint APIndex,uint tokenId) public view returns (string memory) {
        string memory result = createdNFT[APIndex].tokenURI(tokenId);
        return result;
    } 

}
